vector-add-test(node: class benchmark-node)
array1, array2, array3, array4: class quantity-array;
te, ts, tf: quantity;
i: integer;
eq: truth-value;
begin
    create a quantity-array array1;
    create a quantity-array array2;
    create a quantity-array array3;
    create a quantity-array array4;

    change the array-length of array1 to array-size;
    change the array-length of array2 to array-size;
    change the array-length of array3 to array-size;
    change the array-length of array4 to array-size;

    for i = 0 to array-size - 1 do
        change array1[i] = random (0, 100);
        change array2[i] = random (0, 100); 
    end;

    ts = the current subsecond real time;

    for i = 1 to loop-times do
        call g2-array-add (array1, array2, array3);
    end;

    te = the current subsecond real time;
    post "[loop-times] cals to procedure g2-array-add in [te - ts] seconds";

    for i = 1 to loop-times do
        array4 = vector-add (array1, array2, array4);
    end;

    tf = the current subsecond real time;
    post "[loop-times] cals to function vector-add in [tf - te] seconds";

    post "performance improvements: [((te - ts) - (tf - te)) / (te - ts) * 100]%";

    eq = call g2-array-equal(array3, array4);
    if eq then
        call pass(node)
    else begin
        call fail(node, "vector-add result is wrong.")
    end;

    delete array1;
    delete array2;
    delete array3;
    delete array4;
end

scalar-multiply-test(node: class benchmark-node)
array1, array2, array3: class quantity-array;
result: quantity;
te, ts, tf: quantity;
i: integer;
eq: truth-value;
begin
    create a quantity-array array1;
    create a quantity-array array2;
    create a quantity-array array3;

    change the array-length of array1 to array-size;
    change the array-length of array2 to array-size;
    change the array-length of array3 to array-size;

    for i = 0 to array-size - 1 do
        change array1[i] = random (0, 100);
        change array2[i] = random (0, 100);
    end;

    ts = the current subsecond real time;

    for i = 1 to loop-times do
        call g2-scalar-multiply(array1, ts, array2);
    end;

    te = the current subsecond real time;
    post "[loop-times] cals to quantity  scalar-multiply in [te - ts] seconds";

    for i = 1 to loop-times do
        array3 = vector-scalar-multiply(array1, ts, array3);
    end;

    tf = the current subsecond real time;
    post "[loop-times] cals to quantity  scalar-multiply in [tf - te] seconds";

    post "performance improvements: [((te - ts) - (tf - te)) / (te - ts) * 100]%";

    eq = call g2-array-equal(array2, array3);

    if eq then
        call pass(node)
    else begin
        call fail(node, "vector-scalar-multiply result is wrong.")
    end;

    delete array1;
    delete array2;
    delete array3;
end

vector-multiply-test(node: class benchmark-node)
array1, array2: class quantity-array;
result1, result2: quantity;
te, ts, tf: quantity;
i: integer;
begin
    create a quantity-array array1;
    create a quantity-array array2;

    change the array-length of array1 to array-size;
    change the array-length of array2 to array-size;

    for i = 0 to array-size - 1 do
        change array1[i] = random (0, 100);
        change array2[i] = random (0, 100); 
    end;

    ts = the current subsecond real time;

    for i = 1 to loop-times do
        result1 = call g2-array-multiply(array1, array2);
    end;

    te = the current subsecond real time;
    post "[loop-times] calls of procedure g2-array-multiply in [te - ts] seconds";

    for i = 1 to loop-times do
        result2 = vector-multiply(array1, array2);
    end;

    tf = the current subsecond real time;
    post "[loop-times] calls of function vector-multiply in [tf - te] seconds";

    post "performance improvements: [((te - ts) - (tf - te)) / (te - ts) * 100]%";

    if result1 = result2 then
        call pass(node)
    else begin
        call fail(node, "vector-multiply result is wrong.")
    end;

    delete array1;
    delete array2;
end
